import React from 'react'
import './Header.css'
import { Route, Routes } from 'react-router-dom';
import { MainPage } from '../../pages/MainPage';

export function Header() {
    return (
        <div>
            <Routes>
                <Route path='/' element={<MainPage />}></Route>
            </Routes>
        </div>
    )
}
